import React from 'react';
import styled from 'styled-components';



const HomeListingCard = () => {
  const HomeCardStyle = styled.div`
  color: red
  `;
  return (
      <HomeCardStyle>
        Home Listing Card
      </HomeCardStyle>
  )
};

export default HomeListingCard;
